Aspose.PDF for JasperReports 1.0.0
Download&nbsp;
Support Forum&nbsp;
File Details
Downloads: 65 File Size: 8.4 MB Posted By: codewarior Views: 658 Date Added: 5/3/2011
.downloadcount {
background-image: url("/images/loading.svg");
background-repeat: no-repeat;
background-size: 21px;
background-position: -2px 10px;
color: transparent;
}
$.getJSON("https:\/\/releases.admin.aspose.com/api/updatecount?path=62e85f1e4b3d4f25b0a01e91cd05d44b&single=1", function(data) { $.each(data, function(key, value) {
$("#dwn-update-"+ key).css({"background":"none"});
$("#dwn-update-"+ key).css({"color":"#333"});
$("#dwn-update-"+ key).text(value.download_count);
$("#added-update-"+ key).text(value.date_added);
});
});

